import React from 'react';
import logo from './logo.svg';
import './App.css';
import { HttpResponse, useApiClient } from './Services/api/apiClient';
import { useEffect, useState } from 'react';
import { TodoModel } from './types/apiClient';

 function App() {

     const [data, setData] = useState<TodoModel[]>([]);

     const getTodos = async () => {
         let response: HttpResponse<TodoModel[]>;

         response = await useApiClient().getTodos();
         console.log("erresponse");
         console.log(response);
         setData(response.body as TodoModel[]);
        
     };
 
     useEffect(() => {
         getTodos();
         console.log(data);
     }, [])

  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Todo List A
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
  );
}

export default App;
